import React from "react";
import Particles from "react-particles-js";
import { Container, Row, Col } from "react-grid-system";

class parts extends React.Component {
  render() {
    return (
      <div>
        <Particles
          height="100vh"
          style={{
            opacity: "0.8",
            position: "fixed",
            left: "0",
            top: "0"
          }}
          params={{
            particles: {
              number: {
                value: 60,
                density: {
                  enable: true,
                  value_area: 1500
                }
              },
              line_linked: {
                enable: true,
                opacity: 0.02
              },
              move: {
                direction: "right",
                speed: 0.05
              },
              size: {
                value: 1
              },
              opacity: {
                anim: {
                  enable: true,
                  speed: 1,
                  opacity_min: 0.05
                }
              }
            },
            interactivity: {
              events: {
                onclick: {
                  enable: true,
                  mode: "push"
                }
              },
              modes: {
                push: {
                  particles_nb: 1
                }
              }
            },
            retina_detect: true
          }}
        />
        <div
          style={{
            position: "fixed",
            top: "0",
            left: "0",
            margin: "100px",
            zIndex: "-1"
          }}
        >
          <h1>Hi I'm Paridhi and you're watching Disney Channel</h1>
        </div>
      </div>
    );
  }
}

export default parts;
